import React , { useEffect , useState } from "react";

function Test () {

	const [ elcolor , setColor ] = useState();

	useEffect(() => {
		const api = "https://x-colors.herokuapp.com/api/random";
		
		fetch( api )
		.then( api => api.json() )
		.then( api => {
			console.log( api );
			console.log( api.hex );
			var colorRandom = api.hex;
			setColor( colorRandom );
		});
		
	},[]);
	

	return (
		<section className="test">
			<h2>Testsss</h2>
			<img src="https://ouch-cdn2.icons8.com/QWeTLBu04_C-Zvpt3r1FXQbJ9AGRCd55zxwCewo_8QA/rs:fit:456:456/czM6Ly9pY29uczgu/b3VjaC1wcm9kLmFz/c2V0cy9zdmcvNjY5/LzM2YzM2ZmYxLTU5/ZWEtNGM5Zi1hMjlm/LTdmNmZiZDgzODE1/Mi5zdmc.png" alt="search" />
			<div className="hola" style={{ background: { elcolor } , width: '50px' , height: '50px' }}></div>
		</section>
	);
};

export default Test;
